BEGIN TRANSACTION;
CREATE TABLE `walkable_paths` (
	`building`	TEXT,
	`floor`	INTEGER,
	`x_coordinate`	INTEGER,
	`y_coordinate`	INTEGER
);
CREATE TABLE `indoor_maps` (
	`building`	TEXT,
	`floor`	INTEGER,
	`map_height`	INTEGER,
	`map_width`	INTEGER
);
CREATE TABLE building(
 _id INTEGER PRIMARY KEY, 
 name TEXT,
 short_name TEXT, 
 center_coordinate TEXT, 
 edge_coordinates TEXT,
 resource_image_id INTEGER,
 is_small_building INTEGER
, campus TEXT);
CREATE TABLE android_metadata (locale TEXT);
COMMIT;
